-- ----------------------------
DROP TABLE IF EXISTS `bill_cvg_list`;
CREATE TABLE `bill_cvg_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `anchorid` int(11) NOT NULL DEFAULT '0' COMMENT '主播ID',
  `gid` int(11) NOT NULL DEFAULT '0' COMMENT '道具ID',
  `gname` varchar(255) NOT NULL DEFAULT '' COMMENT '道具名称',
  `count` int(11) NOT NULL DEFAULT '0' COMMENT '购买天数',
  `addtime` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `starttime` int(11) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `endtime` int(11) NOT NULL DEFAULT '0' COMMENT '结束时间',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1 座驾,2 vip,3 守护',
  `realpricetotal` int(11) DEFAULT '0' COMMENT '实际支付总金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=utf8 COMMENT='购买座驾,vip,守护记录';

