-- Table structure for `bill_prize_list`
-- ----------------------------
DROP TABLE IF EXISTS `bill_prize_list`;
CREATE TABLE `bill_prize_list` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `uid` int(10) NOT NULL COMMENT '用户id',
  `gid` int(10) NOT NULL COMMENT '礼物id',
  `anchoruid` int(10) NOT NULL COMMENT '主播id',
  `multiples` int(10) NOT NULL COMMENT '倍率',
  `luckyCount` int(11) NOT NULL COMMENT '中奖次数',
  `sendPrice` int(11) DEFAULT NULL COMMENT '送出价格',
  `sendCount` int(11) DEFAULT NULL COMMENT '送出数量',
  `gprice` int(11) NOT NULL COMMENT '礼物单价',
  `priceTotal` int(11) NOT NULL COMMENT '礼物总价',
  `wealthTotal` int(11) NOT NULL COMMENT '财富总值',
  `creditTotal` int(11) NOT NULL COMMENT '声援总值',
  `createAt` int(11) NOT NULL COMMENT '中奖时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

