-- ----------------------------
-- Table structure for `bill_redenvelope`
-- ----------------------------
DROP TABLE IF EXISTS `bill_redenvelope`;
CREATE TABLE `bill_redenvelope` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `roomId` int(11) unsigned NOT NULL COMMENT '房间号即主播uid',
  `reddesc` varchar(100) NOT NULL DEFAULT '' COMMENT '红包说明',
  `isfinish` int(2) unsigned NOT NULL DEFAULT '0' COMMENT '=0 未完成 ＝1完成',
  `srcUid` int(11) unsigned NOT NULL COMMENT '发红包的人',
  `dstUid` int(11) unsigned NOT NULL COMMENT '＝0大众 其他则是单一收红包人',
  `sendmoney` int(8) unsigned NOT NULL COMMENT '红包金额（总）',
  `sendcnts` int(5) unsigned NOT NULL COMMENT '红包数量',
  `getmoney` int(8) unsigned NOT NULL DEFAULT '0',
  `getcnts` int(5) unsigned NOT NULL DEFAULT '0',
  `sendtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '发送红包时间',
  `gettime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '全部抢完时间',
  PRIMARY KEY (`id`),
  KEY `sendtime` (`sendtime`,`isfinish`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8mb4;

