-- ----------------------------
-- Table structure for `live_mic_time`
-- ----------------------------
DROP TABLE IF EXISTS `live_mic_time`;
CREATE TABLE `live_mic_time` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `uid` int(10) unsigned NOT NULL DEFAULT '0',
  `slogan` varchar(100) DEFAULT '‘’' COMMENT 'slogan',
  `province` varchar(30) DEFAULT '‘’' COMMENT '省份',
  `city` varchar(30) DEFAULT '‘’' COMMENT '城市',
  `starttime` int(11) unsigned DEFAULT '0' COMMENT '开播时间',
  `endtime` int(11) unsigned DEFAULT '0' COMMENT '下播时间',
  `audience` int(10) DEFAULT '0' COMMENT '观众数',
  `views` int(5) DEFAULT '0' COMMENT '观看人次',
  `likes` int(10) DEFAULT '0' COMMENT '喜欢数',
  `credit` int(10) DEFAULT '0' COMMENT '声援值',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'type为0表示上麦，1表示下麦',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发生时间',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户直播麦时表';

