  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `anchor` (`anchorUid`,`userUid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='举报列表';

