-- ----------------------------
-- Table structure for `user_transaction_his`
-- ----------------------------
DROP TABLE IF EXISTS `user_transaction_his`;
CREATE TABLE `user_transaction_his` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `trans_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '交易类型(1:欢乐六选三下注;2:欢乐六选三胜出;3:欢乐六选三手续费;4:抓娃娃投下注;5:抓娃娃手胜出;6:抓娃娃手续费;7:开心敲敲乐下注;8:开心敲敲乐胜出;9:开心敲敲乐手续费;10:获得礼物金币;11:赠送礼物金币;12:金币充值;13:购买守护;14:购买VIP;15:购买座驾'')',
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `amount` double NOT NULL DEFAULT '0' COMMENT '金额(人民币)',
  `money` bigint(20) NOT NULL DEFAULT '0' COMMENT '金币',
  `create_time` bigint(20) NOT NULL DEFAULT '0' COMMENT '发生时间',
  `ref_id` varchar(50) NOT NULL DEFAULT '' COMMENT '关联ID',
  `data_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '数据类型 1:真实数据;2:虚拟数据',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=333 DEFAULT CHARSET=utf8;

