-- ----------------------------
-- Table structure for `user_xiaozhu_auth`
-- ----------------------------
DROP TABLE IF EXISTS `user_xiaozhu_auth`;
CREATE TABLE `user_xiaozhu_auth` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `nickname` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '认证昵称',
  `authContent` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '认证内容',
  `authPics` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '认证图片',
  `authURLs` text COLLATE utf8mb4_unicode_ci COMMENT '认证URL',
  `status` int(2) DEFAULT NULL COMMENT '＝1提交待审核 ＝2驳回 ＝3通过',
  `cause` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '驳回原因',
  `createAt` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `auditAt` int(10) DEFAULT '0' COMMENT '审核时间',
  `isdel` int(2) DEFAULT NULL COMMENT '删除标识 0有效 1删除',
  PRIMARY KEY (`id`),
  KEY `index_xiaozhuAuth_uid` (`uid`)
